Da Statuto, gli Organi di governo dell’Istituto Giuseppe Toniolo sono:
a) il Comitato di Indirizzo;
b) il Consiglio di Amministrazione;
c) il Collegio dei Revisori dei Conti.
Nel corso degli anni hanno fatto parte degli organi di governance dell’Istituto: Gianni Ambrosio, Franco Anelli, Armida Barelli, Adriano Bausola, Francesco Bellini, Domenico Bernareggi, Adriano Bernareggi, Giuseppe Bertoni, Dino Boffo, Giuseppe Camadini, Ettore Castelli, Emilio Colombo, Carlo Colombo, Antonio Confalonieri, Mario Cunietti, Giuseppe Dalla Torre, Arturo Danusso, Mario Dosi, Anna Fiecconi, Paolo Fontana, Filippo Franceschini, Ezio Franceschini, Carlo Fratta Pasini, Arcangelo Galli, Edoardo Garbagnati, Luigi Gedda, Agostino Gemelli, Giuseppe Ghisalberti, Silvano Golzio, Luigi Gramatica, Giorgio La Pira, Giuseppe Lazzati, Gianni Letta, Giancarlo Lombardi, Siro Lombardini, Ernesto Lombardo, Felice Martinelli, Carlo Maria Martini, Amati Masnovo, Angelo Mauri, Roberto Mazzotta, Filippo Meda, Piero Melazzini, Alda Miceli, Giovanni Battista Montini, Angelo Moretti, Lodovico Necchi, Attilio Nicora, Francesco Olgiati, Lorenzo Ornaghi, Luigi Ortona, Umberto Padovani, Piero Panighi, Alberto Quadrio Curzio, Giovanni Rossi, Guido Rossi Leoni, Oscar Luigi Scalfaro, Angelo Scola, Giovanni Spagnolli, Anna Maria Tarantola, Angelo Testori, Dionigi Tettamanzi, Vittorino Veronese, Enrico Mario Viora, Francesco Vito, Sergio Zaninelli, Emilio Zanini, Piero Zerbi.

